import React from 'react';
import { Typography } from "@material-ui/core";
import Job from "./Job";

export default function Jobs({jobs}) {
    return (
        <div className="jobs">
            <Typography variant='h3'>
                Jobs
            </Typography>
            {
               
               jobs.map(job => <Job key={job.key} job={job}/>)
            }
        </div>
    )
}
